        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          email, 
          password,
        })
      })

      const data = await response.json();

      if (data.user) {
        localStorage.setItem('token', data.user)
        window.location = data.redirect
      } else {
        alert('Your username and password combination is incorrect')
